INSERT INTO action_text_rich_texts VALUES (3, 'comments', '<div>From Damian</div>', 'Book', 329, '2023-06-14 17:05:07.823532', '2023-06-14 17:05:07.823532');
INSERT INTO action_text_rich_texts VALUES (4, 'comments', '<div>Courtney Wang suggested this book years ago. Tried a sample on kindle and decided not to buy it for 9.99. Maybe someday.</div>', 'Book', 188, '2023-06-14 17:20:28.541083', '2023-06-14 17:20:28.541083');
INSERT INTO action_text_rich_texts VALUES (5, 'comments', '<div>Purchased on bookfinder</div>', 'Book', 302, '2023-06-14 17:24:52.360426', '2023-06-14 17:24:52.360426');
INSERT INTO action_text_rich_texts VALUES (7, 'comments', '<div>Gonna give up on it. The stories aren''t good enough to grip me.</div>', 'Book', 276, '2023-06-14 17:39:54.130411', '2023-06-14 17:39:54.130411');
INSERT INTO action_text_rich_texts VALUES (8, 'comments', '<div>Read a bit. Did some marginalia. Will pick it up again when I have a reason to need to sell.</div>', 'Book', 314, '2023-06-14 17:40:39.352241', '2023-06-14 17:40:39.352241');
INSERT INTO action_text_rich_texts VALUES (9, 'comments', '<div>Suggested by Jeremy Smith and Jess Brown on their podcast. Got a few chapters in, gave up. Maybe I''ll try again someday.</div>', 'Book', 332, '2023-06-14 18:37:59.600546', '2023-06-14 18:37:59.600546');
INSERT INTO action_text_rich_texts VALUES (10, 'comments', '<div><a href="https://twitter.com/jmtame/status/1671000758462939136?s=46&amp;t=Fk6oz4yQTfTG4iqvCLIcWA">https://twitter.com/jmtame/status/1671000758462939136?s=46&amp;t=Fk6oz4yQTfTG4iqvCLIcWA</a><br><br><br></div>', 'Book', 337, '2023-06-20 08:19:31.107418', '2023-06-20 08:19:31.107418');
INSERT INTO action_text_rich_texts VALUES (11, 'comments', '<div>Maybe find an Audible version</div>', 'Book', 339, '2023-06-23 09:39:07.847605', '2023-06-23 09:39:07.847605');
INSERT INTO action_text_rich_texts VALUES (12, 'comments', '<div>From Myles Snyder:<br><br></div><pre>This is another great Mexican cookbook with solid recipes geared towards home cooks.</pre>', 'Book', 343, '2023-06-25 22:54:18.34562', '2023-06-25 22:54:18.34562');
INSERT INTO action_text_rich_texts VALUES (13, 'comments', '<div>From Myles Synder:<br><br></div><pre>Alex Stupak started his career as a molecular gastronomy pastry chef before pivoting to tacos. He approaches Mexican food from the perspective of a highly technical outsider who wants to understand things from first principles. He analyzes and explains concepts super well, and his recipes for staples like salsas, barbacoa, and cochinita pibil are all really good.</pre>', 'Book', 344, '2023-06-25 22:55:37.317721', '2023-06-25 22:55:37.317721');
INSERT INTO action_text_rich_texts VALUES (6, 'comments', '<div>Read a sample. Liked it.<br><br>Reminded me of To Sleep in a Sea of Stars in some ways. Might read the second one.</div>', 'Book', 278, '2023-06-14 17:39:31.674918', '2023-06-26 10:51:40.958819');
INSERT INTO action_text_rich_texts VALUES (2, 'comments', '<div>Saw it in Natalie Nealan’s BeReal. According to her it kinda sucked.</div>', 'Book', 328, '2023-06-14 16:11:17.309592', '2023-06-26 10:53:39.731937');
INSERT INTO action_text_rich_texts VALUES (14, 'comments', '<div>Suggested by Damian, the series Silo is based on them</div>', 'Book', 346, '2023-06-26 14:52:29.442463', '2023-06-26 14:52:29.442463');
INSERT INTO action_text_rich_texts VALUES (15, 'comments', '<div><a href="https://pragprog.com/titles/sbelixir/from-ruby-to-elixir/">https://pragprog.com/titles/sbelixir/from-ruby-to-elixir/</a></div>', 'Book', 348, '2023-06-27 10:12:26.714691', '2023-06-27 10:12:26.714691');
INSERT INTO action_text_rich_texts VALUES (16, 'comments', '', 'Book', 352, '2023-06-27 10:30:30.987844', '2023-06-27 10:30:30.987844');
INSERT INTO action_text_rich_texts VALUES (17, 'comments', '<div>From bookbub:<br><br></div><pre>In the year 2077, two new religious movements on Earth and Venus confront a discovery that will alter the future of humanity… A classic adventure from a Hugo and Nebula Award–winning author hailed as “one of science fiction’s modern masters” (<em>Chicago Sun-Times</em>)!</pre><div><br><br></div>', 'Book', 366, '2023-06-27 13:49:07.172978', '2023-06-27 13:49:07.172978');
INSERT INTO action_text_rich_texts VALUES (19, 'comments', '<div>Loved it. It did have a lot of gun culture worship and basically celebrated vigilante justice which was challenging at times.</div>', 'Book', 192, '2023-07-04 11:15:30.990056', '2023-07-04 11:16:24.883546');
INSERT INTO action_text_rich_texts VALUES (20, 'comments', '<div>Recommended from Reddit </div>', 'Book', 371, '2023-07-06 04:47:27.700806', '2023-07-06 04:47:27.700806');
INSERT INTO action_text_rich_texts VALUES (21, 'comments', '<div>From Roshan:<br><br></div><blockquote>What’s your address? I’ve got another good book for you, a guy from the Turkey trip sent it to me but I’ve already read it If you’ve noticed the UFO people using terms like “inter “interdimensional” or “non human” instead of “extraterrestrial”, it’s because of this book </blockquote><div><br></div>', 'Book', 379, '2023-07-17 20:26:41.317125', '2023-07-17 20:26:49.484042');
INSERT INTO action_text_rich_texts VALUES (54, 'comments', '<div><a href="https://twitter.com/mronge/status/1682079022576967684?s=46&amp;t=Fk6oz4yQTfTG4iqvCLIcWA">https://twitter.com/mronge/status/1682079022576967684?s=46&amp;t=Fk6oz4yQTfTG4iqvCLIcWA</a><br><br><br></div>', 'Book', 413, '2023-07-20 17:40:30.569772', '2023-07-20 17:40:30.569772');
INSERT INTO action_text_rich_texts VALUES (55, 'comments', '<div>Very cool. Got it in Ireland. Cool premise.</div>', 'Book', 367, '2023-08-16 08:32:34.523791', '2023-08-16 08:32:34.523791');
